import { Component } from '@angular/core';

@Component({
  selector: 'app-nav',
  templateUrl: './nav.component.html',
  styleUrls: ['./nav.component.scss']
})
export class NavComponent {
 isCollapsed = false;
}
<nav class="navbar navbar-expand-lg">
  <div class="container-fluid">
    <a class="navbar-brand txt-color" href="#">Yhiot</a>
    <button class="navbar-toggler btnBg" (click)="isCollapsed = !isCollapsed" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
      <span class="navbar-toggler-icon"></span> Expand
    </button>
    <div class="collapse navbar-collapse" [collapse]="isCollapsed" [isAnimated]="true" id="navbarNav">
      <ul class="navbar-nav">
        <li class="nav-item">
          <a class="nav-link active txt-color" aria-current="page" href="#">Agendamentos</a>
        </li>
        <li class="nav-item">
          <a class="nav-link txt-color" href="#">Consultas</a>
        </li>
        <li class="nav-item">
          <a class="nav-link txt-color" href="#">Menu</a>
        </li>
      </ul>
    </div>
  </div>
</nav>
<style>
  .navbar{
    background-color: rgb(99, 99, 225);
  }
  .txt-color{
    color: white;
  }

  .btnBg{
    border: 2px solid rgb(255, 255, 255);
    border-radius: 20px;
    font-size: 16px;
    text-align: center;
  }

</style>
